// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./FakeUSDC.sol";

contract BscBridge {
    address owner;
    uint balance;
    FakeUSDC usdc = new FakeUSDC();
    constructor() {
        owner = msg.sender;
    }

    function calc_fee(uint _amount) public view returns(uint) {
        return _amount * 4 / 10000;
    }

    function balanceOf() public view returns (uint) {
        return balance;
    }

    function deposit(uint _amount) public returns (bool) {
        usdc.transfer(address(this), _amount);
        return true;
    }

    function withdraw(uint _amount) public returns(bool) {
        usdc.withdraw(address(this), _amount);
        return true;
    }   
}
